import React from "react";
import RenderArea from "./RenderArea";
import SearchArea from "./SearchArea";
import Card from "../components/Card";

function Content() {
    const newData = [];

    return (
        <div>
            <SearchArea
                handleNewData={newData}
            />
            {newData.map((item, index) => {
                return (
                    <Card
                        key={index}
                        id={index}
                        title={item.title}
                    />
                );
            })}
        </div>
    );
}

export default Content;
